import React from "react";


const FeedbackTable = ({ feedbacks, limit }) => {
  const sorted = [...feedbacks]
    .sort((a, b) => new Date(b.submittedOn) - new Date(a.submittedOn));

  const finalList = limit ? sorted.slice(0, limit) : sorted;

  return (
    <table>
      <thead>
        <tr>
          <th>Mentor</th>
          <th>Week</th>
          <th>Submitted On</th>
          <th>Status</th>
        </tr>
      </thead>

      <tbody>
        {finalList.map((f) => (
          <tr key={f.id}>
            <td>{f.mentorName}</td>
            <td>{f.week}</td>
            <td>
              {f.submittedOn
                ? new Date(f.submittedOn).toLocaleDateString()
                : "N/A"}
            </td>

            <td
              style={{
                color:
                  f.status === "Pending"
                    ? "red"
                    : f.status === "Approved"
                    ? "green"
                    : "black",
                fontWeight: "600",
              }}
            >
              {f.status === "Pending"
                ? `⏳ ${f.status}`
                : f.status === "Approved"
                ? `✅ ${f.status}`
                : f.status}
            </td>
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default FeedbackTable;
